import './App.css';
import Header from './components/Layout/Header';
import MealsSummary from './components/Meals/MealsSummary';
import Meal from './components/Meals/Meal';
import Cart from './components/Cart/Cart';

function App() {
  return (
    <div>
      <Cart />
      <Header />
      <main>
        <MealsSummary />
        <Meal />
      </main>
    </div>
  );
}

export default App;
